import React, { useEffect, useState } from 'react';
import { getClientsByManager } from '../api/ClientService'; // путь адаптируйте под свой проект

const ClientList = ({ managerId }) => {
    const [clients, setClients] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchClients = async () => {
            try {
                const data = await getClientsByManager(managerId);
                setClients(data);
            } catch (err) {
                setError('Ошибка при загрузке клиентов');
            } finally {
                setLoading(false);
            }
        };

        if (managerId) {
            fetchClients();
        }
    }, [managerId]);

    if (loading) return <p>Загрузка...</p>;
    if (error) return <p>{error}</p>;

    return (
        <div>
            <h2>Список клиентов</h2>
            {clients.length === 0 ? (
                <p>Клиенты не найдены.</p>
            ) : (
                <ul>
                    {clients.map(client => (
                        <li key={client.id}>
                            <strong>Телефон:</strong> {client.phone} <br />
                            <strong>Паспорт:</strong> {client.passport} <br />
                            <strong>Уровень доступа:</strong> {client.accessLevel} <br />
                            {client.preferences.length > 0 && (
                                <>
                                    <h3>Пожелания:</h3>
                                    <ul>
                                        {client.preferences.map((preference, index) => (
                                            <li key={index}>
                                                <p><strong>Мин. площадь:</strong> {preference.minArea} м²</p>
                                                <p><strong>Макс. площадь:</strong> {preference.maxArea} м²</p>
                                                <p><strong>Мин. цена:</strong> {preference.minPrice} ₽</p>
                                                <p><strong>Макс. цена:</strong> {preference.maxPrice} ₽</p>
                                                <p><strong>Количество комнат:</strong> {preference.roomsCount}</p>
                                                <p><strong>Балкон:</strong> {preference.hasBalcony ? 'Есть' : 'Нет'}</p>
                                                <p><strong>Разрешены питомцы:</strong> {preference.allowPets ? 'Да' : 'Нет'}</p>
                                                <p><strong>Город:</strong> {preference.city}</p>
                                                <p><strong>Район:</strong> {preference.district}</p>
                                                <p><strong>Улица:</strong> {preference.street}</p>
                                                <p><strong>Дополнительные примечания:</strong> {preference.additionalNotes}</p>
                                            </li>
                                        ))}
                                    </ul>
                                </>
                            )}
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default ClientList;
